import React from 'react';
import { Navbar, Nav } from 'react-bootstrap';
import { AiOutlineHome, RiBoxingFill, BsPersonFillAdd, GiPapers, FaFileMedical } from 'react-icons/all';
import "./navlinks.css";

const Navlinks = () => {
  return (
    <Navbar expand="lg" variant="dark">
      <Navbar.Brand href="/" id="logoLink">
        {/* Your logo or brand */}
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="responsive-navbar-nav" />
      <Navbar.Collapse id="responsive-navbar-nav">
        <Nav className="mr-auto">
          <Nav.Link href="https://bozierwedding.netlify.app/">
            <AiOutlineHome /> Home
          </Nav.Link>
          <Nav.Link href="https://bozierwedding.netlify.app/rsvp">
            <RiBoxingFill /> RSVP
          </Nav.Link>
          <Nav.Link href="https://bozierwedding.netlify.app/schedule">
            <BsPersonFillAdd /> Schedule
          </Nav.Link>
          <Nav.Link href="https://bozierwedding.netlify.app/weddingParty">
            <GiPapers /> Wedding Team
          </Nav.Link>
          <Nav.Link href="https://bozierwedding.netlify.app/registry">
            <FaFileMedical /> Registry
          </Nav.Link>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}

export default Navlinks;
